import styled from 'styled-components';
import { Link } from 'react-router-dom';



const StyledTable = styled.table`

`;


const StyledRow = styled.tr`

`;


const TableRow = ({ row }) => {
    <tr>
        <td key={index}>{row.branch}</td>
        <td key={index}>{row.street}</td>
        <td key={index}>{row.city}</td>
        <td key={index}>{row.state}</td>
        <td><a href='#'>Show</a> | <a href="#">Edit</a> | <a href="#">Destroy</a></td>
    </tr>
}



const Table = (props) => {
    return (
        <div style={{width: "600px", height: '600px', margin: '50px auto'}}>
            <section>
                    <h2>Your wish list:</h2>
                    <StyledTable>
                        <tbody>
                            <tr>
                                <th>Coding Dojo Branch</th>
                                <th>Street</th>
                                <th>City</th>
                                <th>State</th>
                                <th>Actions</th>
                            </tr>
                            { props.data.map(row => { <TableRow row={row} /> })}
                        </tbody>
                    </StyledTable>
                </section>
                <Link to="/new">New Dojo</Link>
        </div>
    );
}

export default Table;
